Native to the Mile High City, Hartshorn has been spreading the UK Hardcore sounds over the past decade. Collaborations throughout the years alongside many international artists, landing signings on leading labels such as Keeping The Rave Alive, Evolution & Futureworld as well as international releases on multiple Hardcore Heaven album compilations. The last few years have kept him on the radar with annual UK tours under his belt, being featured on events such as Clubland Live Weekender, Clubland Classix, and Hardcore Heaven: Los Angeles. The Hartshorn sound has caught the attention of artists across multiple outside genres, with the most notable being from Kayzo at EDC Mexico 2020. Hartshornâ€™s 2020 releases through Keeping The Rave Alive & 24/7 Hardcore have claimed multiple Top10 spots on Beatportâ€™s Hard Dance chart, and have granted him with a signing to UK based label 24/7 Hardcore.

