New England based, G-Odyssey is an electronic music producer with a focus on heavy beats, emotional atmospheres and dark bass lines. Drawing inspiration from many different styles of music, he delivers his own brand of creativity. Apart from all the classic tropes found in his music, is it no question that he values innovation and organics when it comes to his work.  Writing new music day and night, G-Odyssey has many releases planned for the future to add to his growing discography and shows no sign of slowing down. 

